// SPDX-License-Identifier: GPL-3.0

pragma solidity ^0.8.1;

contract SharedWallet {
    // create variable for owner address
    // this address will use for create permission:
    // only owner can withdraw Ether
    address owner;

    constructor() {
        // fill owner with owner address
        // owner address is the address who deployed the smart contract
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "You are not allowed");
        _;
    }

    // functio to withdraw Ether to a specific address with specific amount
    // add onlyOwner modifier to restrict withdraw function just for the owner
    function withdrawMoney(address payable _to, uint _amount) public onlyOwner {
        _to.transfer(_amount);
    }

    receive() external payable {

    }
}

